import styled from "styled-components"
import { Content } from "../components/modules"
import { useState } from "react"

const Footer = () => {
  const [open, setOpen] = useState(false)

  return (
    <Background>
      <Content>
        <div>MOTI</div>
        <div>E-mail: A704@gmail.com</div>
      </Content>
      <Copyright onClick={() => setOpen(!open)}>©Copyright</Copyright>
      {open && <CopyrightModal setOpen={setOpen} />}
    </Background>
  )
}

const CopyrightModal = (props: any) => {
  return (
    <Modal>
      <a
        href="https://www.flaticon.com/free-icons/animal-feed"
        title="animal feed icons"
      >
        Animal feed icons created by Nikita Golubev - Flaticon
      </a>
      <br />
      <a href="https://www.flaticon.com/free-icons/heart" title="heart icons">
        Heart icons created by Kiranshastry - Flaticon
      </a>
      <br />
      <a href="https://www.flaticon.com/free-icons/cart" title="cart icons">
        Cart icons created by Pixel perfect - Flaticon
      </a>
      <br />
      <a href="https://www.flaticon.com/free-icons/gift" title="gift icons">
        Gift icons created by Octopocto - Flaticon
      </a>
      <br />
      <a href="https://www.flaticon.com/free-icons/shield" title="shield icons">
        Shield icons created by Smashicons - Flaticon
      </a>
      <br />
      <a href="https://www.flaticon.com/free-icons/color" title="color icons">
        Color icons created by Nikita Golubev - Flaticon
      </a>
      <br />
      <button onClick={() => props.setOpen(false)}>Close</button>
    </Modal>
  )
}

export default Footer

const Background = styled.div`
  height: 15vh;
  background: #5a6078;
  display: flex;
  align-items: center;
  justify-content: space-evenly;
  color: white;
`

const Copyright = styled.div`
  cursor: pointer;
`

const Modal = styled.div`
  width: 30%;
  height: 15vh;
  background: white;
  position: absolute;
`
